import React from 'react';

export default function AnswerFeedback({ messageId, sessionId, feedback }) {
  function sendFeedback(type) {
    // This demo does not persist feedback to backend; adjust for real server.
    alert(`Feedback (${type}) recorded for ${messageId}`);
  }
  return (
    <div className="mt-2 flex items-center gap-3">
      <button onClick={() => sendFeedback('like')} className="px-2 py-1 rounded border">üëç {feedback?.likes || 0}</button>
      <button onClick={() => sendFeedback('dislike')} className="px-2 py-1 rounded border">üëé {feedback?.dislikes || 0}</button>
    </div>
  );
}
